      "definition": "Epileptogenicity Parameter. Degree of excitability or epileptogenicity in Epileptor5D (Jirsa et al.,2014).\n\nIf x0 is greater than a critical value, x0,critic = âˆ’2.05, the system can trigger seizures autonomously; otherwise it is in its equilibrium state.\n\nNote:\n- If modification_E5D:\nif x0 is smaller than a critical value, x0,critic = 2.91, can trigger seizures autonomously; otherwise it is in its equilibrium state (Proix et al., 2014).",
